@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATM rdf:type owl:Class .
atm:Money rdf:type owl:Class .
atm:Withdrawal rdf:type owl:Class .
atm:Bank rdf:type owl:Class .

atm:dispenses rdf:type owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Money .

atm:processes rdf:type owl:ObjectProperty ;
    rdfs:domain atm:Bank ;
    rdfs:range atm:Withdrawal .

atm:accepts rdf:type owl:ObjectProperty ;
    rdfs:domain atm:Bank ;
    rdfs:range atm:Withdrawal .

atm:Withdrawal owl:equivalentClass [
    rdf:type owl:Class ;
    owl:intersectionOf (
        atm:Withdrawal
        [ rdf:type owl:Restriction ;
          owl:onProperty atm:processes ;
          owl:someValuesFrom atm:Bank
        ]
        [ rdf:type owl:Restriction ;
          owl:onProperty atm:accepts ;
          owl:someValuesFrom atm:Bank
        ]
    )
] .

atm:ATM owl:equivalentClass [
    rdf:type owl:Class ;
    owl:intersectionOf (
        atm:ATM
        [ rdf:type owl:Restriction ;
          owl:onProperty atm:dispenses ;
          owl:someValuesFrom atm:Money
        ]
    )
] .
